export const MOVIE_SEARCH = "MOVIE_SEARCH";

const initialState = {
  loading: false,
  response: false
};

function movieSearch(state = initialState, action) {
  switch (action.type) {
    case MOVIE_SEARCH:
      return Object.assign({}, state, { movies: action.payload.movies });
    default:
      return state;
  }
}

export default movieSearch;
